#include "Assets/Sprites.hpp"
#include "questui/shared/BeatSaberUI.hpp"
using UnityEngine::Sprite;

const string Sprites::BeatLeaderB64 = "";

Sprite* Sprites::BeatLeaderIcon;
Sprite* Sprites::get_BeatLeaderIcon() {
    if (!BeatLeaderIcon) {
        BeatLeaderIcon = QuestUI::BeatSaberUI::Base64ToSprite(const_cast<string&>(BeatLeaderB64));
    }
    return BeatLeaderIcon;
}

